INSERT INTO `t_activity` VALUES ('584aebcb-9f52-4e20-b8f4-969503e08a85', '活动简述:为了满足广大儿童与家长的娱乐、交流、学习需求,让我们的孩子们有一块专属于自己的屏幕与天空，晚报拟将晚报内部电影厅打造成专属的儿童亲子影院，定期播放专属儿童的各类电影与演出活动,如英语专场、爸爸去看电影专场、假期电影周、动漫专场等等,让亲子家庭在娱乐中提升、在快乐中沉思。同时影院将并与商业机构合作,开展各类知识讲座与交流,如儿童保险、家庭理财、儿童教育、母婴用品交流等等，在丰富儿童的业余生活，服务亲子家庭的基本需求的同时，促进家庭和谐，让父母与子女相互尊重、共同教育、一起成长。\n', 4, '2022-04-01', '2022-04-30', '2022-03-31 17:04:58');
INSERT INTO `t_activity` VALUES ('d7244102-b7b2-4a0c-8601-b8643b9f361c', '影城现场小游戏:寻找配音啦!——视音结合 \n暴料更是凶猛(用自己的话恶搞一段经典电影对白)\n用电视墙播放经典影片(越经典的越好),播放完毕后 ,参赛\n选手有十分钟考虑、组织语言的时间,根据演员嘴型、表情等给影片片\n段自主配音，可模仿、恶搞、乡言等,不拘一格!\n比如:大话西游里的那个“曾经有\"一段，恶搞为“曾经有一碗好\n吃的炸酱面摆在我面前，可是我口袋里钱不够,只好忍痛说，我还不太饿.....\n获得掌声最多、最猛烈的，可获得男、女配音奖项, 颁发奖杯及奖品。', 0, '2022-06-01', '2022-06-20', '2022-04-08 18:46:48');

